function decode(type, data) {
    data = utils.stripHexPrefix(data);
    var decodedData = abi.rawDecode([type], new Buffer(data, 'hex'));
    return decodedData;
}

function methodID(method, data) {
    var id = abi.methodID(method, data);
    return id;
}

